(23, 71, 1, 43, 44, 1, 'joomla', 'com_weblinks', 'Joomla', 'joomla', '', '<p>Joomla is one of the world’ s most popular open source CMS (content management system). With millions of websites running on Joomla, the software is used by individuals, small & medium-sized businesses, and large organizations worldwide to easily create & build a variety of websites & web-enabled applications.</p>', 1, 0, '0000-00-00 00:00:00', 1, '{"category_layout":"","image":""}', '', '', '{"author":"","robots":""}', 994, '2012-03-01 20:55:06', 0, '0000-00-00 00:00:00', 0, '*'),
(24, 72, 1, 45, 46, 1, 'apple', 'com_weblinks', 'Apple', 'apple', '', '<p>Apple Inc. (NASDAQ: AAPL) formerly Apple Computer, Inc. is an American multinational corporation that designs and sells consumer electronics, computer software, and personal computers. The company''s best-known hardware products are the Macintosh line of computers, the iPod, the iPhone and the iPad. Its software includes the Mac OS X operating system; the iTunes media browser; the iLife suite of multimedia and creativity software; the iWork suite of productivity software; Aperture, a professional photography package; Final Cut Studio, a suite of professional audio and film-industry software products; Logic Studio, a suite of music production tools; the Safari web browser; and iOS, a mobile operating system.</p>', 1, 0, '0000-00-00 00:00:00', 1, '{"category_layout":"","image":""}', '', '', '{"author":"","robots":""}', 994, '2012-03-01 20:55:59', 0, '0000-00-00 00:00:00', 0, '*'),
(25, 73, 1, 47, 48, 1, 'google', 'com_weblinks', 'Google', 'google', '', '<p>Google Inc. (NASDAQ: GOOG) is an American multinational Internet and software corporation specialized in Internet search, cloud computing, and advertising technologies. It hosts and develops a number of Internet-based services and products,[5] and generates profit primarily from advertising through its AdWords program.[6][7] The company was founded by Larry Page and Sergey Brin while they were both attending Stanford University.\r\nGoogle was first incorporated as a privately held company on September 4, 1998, and its initial public offering followed on August 19, 2004.</p>', 1, 0, '0000-00-00 00:00:00', 1, '{"category_layout":"","image":""}', '', '', '{"author":"","robots":""}', 994, '2012-03-01 20:59:24', 0, '0000-00-00 00:00:00', 0, '*'),
