(2, 34, 'Module styles', 'module-styles', '', '<p>With the module styles you can see in this page you can set the way a module is displayed.</p>\r\n\r\n<p>To set the style of a module, login to the administrator''s control panel, go to the Module Manager, locate and edit the Module Suffix data field and click the Save button. Alternatively, you can read our tutorials where you can find simple step by step examples.</p>', '', -2, 0, 0, 2, '2011-11-04 13:53:19', 994, '', '2012-03-01 16:11:28', 42, 0, '0000-00-00 00:00:00', '2011-11-04 13:53:19', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 18, 0, 7, '', '', 1, 4959, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(7, 50, 'Vulputate id amet ultricies blandit dicta', 'sample-article-1', '', '<img style="margin: 0 12px 12px 0;" src="images/sampledata/image-article-1.jpg" class="brdr" alt="" align="left" /><p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\r\n', '\r\n<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using ''Content here, content here'', making it look like readable English.</p>\r\n<p>Has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source.</p>\r\n<h3>Phasellus et massa sem, vel viverra erat</h3>\r\n<ul class="bt_arrow_list-1">\r\n<li>Cras hendrerit pulvinar erat, in eleifend tellus convallis varius.</li>\r\n<li>Proin id risus nibh, eget interdum lectus</li>\r\n<li>Proin a odio mauris, sed gravida lorem.</li>\r\n<li>Suspendisse tempor egestas ante, id viverra mi fringilla quis.</li>\r\n<li>Quisque tincidunt arcu vel turpis posuere aliquam.</li>\r\n</ul>\r\n<h3>Sed et massa sed arcu eleifend venenatis ut non diam</h3>\r\n<p>Has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source.</p>\r\n<p class="bt_quad_s1_n1"> All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet. It uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum.</p>\r\n<p class="bt_quad_s1_n2">The standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from "de Finibus Bonorum et Malorum" by Cicero are also reproduced in their exact original form, accompanied</p>\r\n<p class="bt_quad_s1_n3">Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for ''lorem ipsum'' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose.</p>\r\n<h3>The standard chunk of Lorem Ipsum used since the 1500s</h3>\r\n<p>Has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source.</p>', -2, 0, 0, 8, '2012-03-01 18:13:33', 994, '', '2012-04-09 08:08:27', 42, 0, '0000-00-00 00:00:00', '2012-03-01 18:13:33', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","target