(3, 41, 'Template map', 'template-map', '', '<p>Map of regular module positions for the template. An alternative way to see this map on your website is to use the URI parameter tp=1. For example, if your website is "example.com" you can see the template positions by typing <strong>http://www.example.com/?tp=1</strong></p><br />\r\n<div align="center"><img src="images/bt/template_map.png" alt="" /></div>', '', -2, 0, 0, 2, '2011-11-04 13:52:57', 994, '', '2013-02-05 08:04:16', 42, 0, '0000-00-00 00:00:00', '2011-11-04 13:52:57', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 28, 0, 9, '', '', 1, 1265, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
