(34, 50, 'How to use the Sliders', 'how-to-use-the-sliders', '', '<p>You can insert the below code in a custom html module to get the same result as our demo home page.</p>\r\n\r\n<h1>jQuery Nivo Slider</h1>\r\n<pre class="brush: xml;">\r\n&lt;div style=&quot;width: 640px; margin: 0 auto;&quot;&gt;<br />\r\n&lt;div class=&quot;slider-wrapper theme-default&quot;&gt;<br />\r\n&lt;div id=&quot;bt_nivo_slider_fade_slow&quot; class=&quot;nivoSlider&quot;&gt;<br />\r\n&lt;img src=&quot;images/sampledata/image-nivo-1.jpg&quot; alt=&quot;image 1&quot; /&gt;<br />\r\n&lt;img src=&quot;images/sampledata/image-nivo-2.jpg&quot; alt=&quot;image 2&quot; /&gt;<br />\r\n&lt;img src=&quot;images/sampledata/image-nivo-3.jpg&quot; alt=&quot;image 3&quot; /&gt;<br />\r\n&lt;/div&gt;<br />\r\n&lt;/div&gt;<br />\r\n&lt;/div&gt;\r\n</pre>\r\n\r\n<h1>Scrollable Slider</h1>\r\n<pre class="brush: xml;">\r\n&lt;div class=&quot;bt_scrollable_slider_outer&quot; align=&quot;center&quot;&gt;<br />\r\n&lt;table border=&quot;0&quot; cellspacing=&quot;0&quot; cellpadding=&quot;0&quot; style=&quot;border-collapse: collapse;&quot; align=&quot;center&quot;&gt;<br />\r\n&lt;tr&gt;<br />\r\n&lt;td&gt;&lt;a class=&quot;bt_prev bt_browse bt_left&quot;&gt;&lt;/a&gt;&lt;/td&gt;<br />\r\n&lt;td&gt;&lt;div class=&quot;scrollable bt_scrollabe_slider&quot; id=&quot;scrollable&quot; style=&quot;width: 510px !important; height: 245px !important;&quot;&gt;<br />\r\n&lt;div class=&quot;bt_items&quot;&gt;<br />\r\n&lt;div&gt;<br />\r\n&lt;div class=&quot;bt_item&quot; style=&quot;width: 120px; height: 245px;&quot;&gt;<br />\r\n&lt;div class=&quot;bt_item_inner&quot;&gt;<br />\r\n&lt;div class=&quot;bt_item_image&quot;&gt;&lt;img src=&quot;images/sampledata/image-scrollable-1.jpg&quot; width=&quot;120&quot; height=&quot;245&quot; alt=&quot;scrollable image&quot; /&gt;&lt;/div&gt;<br />\r\n&lt;/div&gt;<br />\r\n&lt;/div&gt;<br />\r\n&lt;div class=&quot;bt_item&quot; style=&quot;width: 120px; height: 245px;&quot;&gt;<br />\r\n&lt;div class=&quot;bt_item_inner&quot;&gt;<br />\r\n&lt;div class=&quot;bt_item_image&quot;&gt;&lt;img src=&quot;images/sampledata/image-scrollable-2.jpg&quot; width=&quot;120&quot; height=&quot;245&quot; alt=&quot;scrollable image&quot; /&gt;&lt;/div&gt;<br />\r\n&lt;/div&gt;<br />\r\n&lt;/div&gt;<br />\r\n&lt;div class=&quot;bt_item&quot; style=&quot;width: 120px; height: 245px;&quot;&gt;<br />\r\n&lt;div class=&quot;bt_item_inner&quot;&gt;<br />\r\n&lt;div class=&quot;bt_item_image&quot;&gt;&lt;img src=&quot;images/sampledata/image-scrollable-3.jpg&quot; width=&quot;120&quot; height=&quot;245&quot; alt=&quot;scrollable image&quot; /&gt;&lt;/div&gt;<br />\r\n&lt;/div&gt;<br />\r\n&lt;/div&gt;<br />\r\n&lt;div class=&quot;bt_item&quot; style=&quot;width: 120px; height: 245px;&quot;&gt;<br />\r\n&lt;div class=&quot;bt_item_inner&quot;&gt;<br />\r\n&lt;div class=&quot;bt_item_image&quot;&gt;&lt;img src=&quot;images/sampledata/image-scrollable-4.jpg&quot; width=&quot;120&quot; height=&quot;245&quot; alt=&quot;scrollable image&quot; /&gt;&lt;/div&gt;<br />\r\n&lt;/div&gt;<br />\r\n&lt;/div&gt;<br />\r\n&lt;/div&gt;<br />\r\n&lt;div&gt;<br />\r\n&lt;div class=&quot;bt_item&quot; style=&quot;width: 120px; height: 245px;&quot;&gt;<br />\r\n&lt;div class=&quot;bt_item_inner&quot;&gt;<br />\r\n&lt;div class=&quot;bt_item_image&quot;&gt;&lt;img src=&quot;images/sampledata/image-scrollable-5.jpg&quot; width=&quot;120&quot; height=&quot;245&quot; alt=&quot;scrollable image&quot; /&gt;&lt;/div&gt;<br />\r\n&lt;/div&gt;<br />\r\n&lt;/div&gt;<br />\r\n&lt;div class=&quot;bt_item&quot; style=&quot;width: 120px; height: 245px;&quot;&gt;<br />\r\n&lt;div class=&quot;bt_item_inner&quot;&gt;<br />\r\n&lt;div class=&quot;bt_item_image&quot;&gt;&lt;img src=&quot;images/sampledata/image-scrollable-6.jpg&quot; width=&quot;120&quot; height=&quot;245&quot; alt=&quot;scrollable image&quot; /&gt;&lt;/div&gt;<br />\r\n&lt;/div&gt;<br />\r\n&lt;/div&gt;<br />\r\n&lt;div class=&quot;bt_i