(177, 'Main text', '', '<img src="images/sampledata/main-image-1.jpg" alt="main image" style="float:left;margin: 15px 10px 10px 0;" />\r\n\r\n<p align="justify">EIDON è una azienda innovativa specializzata nella progettazione, realizzazione, integrazione di sistemi di visione per l''automazione industriale e strumentazione di laboratorio. \r\nLa proposta di EIDON è rivolta in maniera particolare ai responsabili delle linee di produzione che hanno la necessità di applicazioni progettate su misura.</p>\r\n<center><img src="images/old/SimplyInn.gif" alt="" /></center><br />\r\n<p align="justify"> Questa esigenza spesso non può essere soddisfatta né da sistemi di visione "general purpose" configurabili né da integrazioni estemporanee.\r\n  EIDON offre soluzioni che assicurano affidabilità e flessibilità grazie ad uno sviluppo modulare ed espandibile</p>', 1, 'newsflash', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
