INSERT INTO `jos_virtuemart_categories_en_gb` (`virtuemart_category_id`, `category_name`, `category_description`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(1, 'Fusce vitae', 'Donec sed ligula sit amet elit ornare interdum ac at lacus. Integer mollis, metus et pellentesque lacinia, turpis dui posuere augue, eget accumsan quam lectus sit amet leo. Maecenas eget neque magna. Donec facilisis, magna non tempus consequat, arcu sem tristique diam, ac convallis sapien arcu ut mauris.', '', '', '', 'fusce-vitae'),
(2, 'Praesent auctor', 'Aliquam gravida ultrices leo, in sagittis mauris vehicula eu. Maecenas tincidunt tortor et nisi tristique dignissim. Nunc velit ligula, cursus et pharetra vitae, tincidunt at orci.', '', '', '', 'praesent-auctor'),
(3, 'Praesent vel libero', '<p>Curabitur tellus est, pulvinar nec porta a, lacinia ac erat. Maecenas ac dolor a nisl bibendum scelerisque. Nullam quis sagittis urna.</p>', '', '', '', 'praesent-vel-libero'),
(5, 'Vestibulum veleaue', 'Donec a nisl sapien, vel faucibus libero. Integer aliquam lectus vitae turpis mattis tincidunt eu ac lacus. Vivamus ipsum odio, aliquam eu blandit quis, egestas at arcu. Vestibulum vel augue purus, et viverra mauris.', '', '', '', 'vestibulum-vel-augue'),
(15, 'Duis accumsan', 'Proin lacus urna, ultricies eget rhoncus ut, laoreet eget tellus. Praesent vitae dolor a mauris aliquam facilisis.', '', '', '', 'duis-accumsan'),
(17, 'Pellentesque sed', 'Curabitur laoreet, arcu ut ullamcorper commodo, metus nibh placerat dui, et sodales.', '', '', '', 'pellentesque-sed'),
(19, 'Maecenas tortor', 'Aliquam sed condimentum tellus. Pellentesque bibendum sem dictum est luctus eleifend at et massa.', '', '', '', 'maecenas-tortor');
