INSERT INTO `jos_virtuemart_shipmentmethods_en_gb` (`virtuemart_shipmentmethod_id`, `shipment_name`, `shipment_desc`, `slug`) VALUES
(1, 'DHL', 'DHL quote is shown in the calculator if it is available in selected Shipito location. Customer is responsible to make sure no restricted items are being shipped. DHL list of restricted items.', 'dhl'),
(2, 'FedEx', 'Very fast and very reliable. Offers better tracking than USPS. We offer both FedEx Priority and Economy service. Size limits: Max. length 108 inches. Length + (2 x width) + (2 x height) less than 130 inches. Our contract with FedEx doesn''t allow guarantee for speed of delivery due to the discounts we get.', 'fedex'),
(3, 'Fedex Freight', 'For packages with billing weight over 150 lbs (68kg). This can be either dimensional weight or real weight. Also can be used for multiple packages, which can be placed on pallet and shipped to you.', 'fedex-freight'),
(4, 'TNT', 'TNT is available on if see it on the shipping calculator in all locations. We offer two different service levels, TNT Express (2-4 business days), and TNT Economy (4-6 business days). Delivery from Tualatin, OR location may take 1-2 days longer than from California.', 'tnt');
